import React , { Component } from 'react';

class Header extends Component {
    render() {
        const headerStyle = {
            width : '100%' ,
            height: '50px' ,
            background : '#000000'
        }
        const title = {
            margin: 0,
            lineHeight : '50px',
            color : '#ffffff'
        }
        return(
            <div style={headerStyle}>
                <h4>tenine's blog</h4>
            </div>
        )
    }
}

export default Header;
